import React from "react";
import './Servicos.css'

function Servicos(){
    return(
        <section className="servicos" id="servicos">
            <h1>Serviços</h1>
            <img src="/imagens/servs.jpg" id="a"/>

            <p id="txt">Esse sou eu mordendo o cabo do teclado da minha humana de estimação, <br/>
            é um trabalho cansativo mas eu não desisto nunca! </p>
        
        </section>
        )
}

export default Servicos
